import React, { useState } from 'react';
import styles from './Home.css'; // Reutilizando estilo ou crie um novo

function Cadastro() {
  // Gerenciamento de estado de formulário
  const [formData, setFormData] = useState({ name: '', category: '', image: '' });

  function handleChange(e) {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  }

  function handleSubmit(e) {
    e.preventDefault();
    console.log('Dados enviados (Simulação Axios Post):', formData);
    alert('Personagem cadastrado (apenas no console por enquanto)!');
  }

  return (
    <div className={styles.container}>
      <h1>Novo Personagem</h1>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: '10px', maxWidth: '400px' }}>
        <input 
            type="text" 
            name="name" 
            placeholder="Nome" 
            onChange={handleChange} 
            required 
        />
        <input 
            type="text" 
            name="category" 
            placeholder="Categoria (ex: Ninja)" 
            onChange={handleChange} 
        />
        <input 
            type="text" 
            name="image" 
            placeholder="URL da Imagem" 
            onChange={handleChange} 
        />
        <button type="submit">Cadastrar</button>
      </form>
    </div>
  );
}

export default Cadastro;
